import scroll from './scroll.vue'

const install = function (Vue, config = {}) {
  if (install.installed) return
  Vue.component(scroll.name, scroll)
}

if (typeof window !== 'undefined' && window.Vue) {
  install(window.Vue)
}

export default {
  install
}
